import React from "react";
import Languages from "./Languages";

const Country = ({country}) => {
    return (
        <div>
            <h2>{country.name}</h2>
            <p>capital {country.capital}</p>
            <p>area {country.area}</p>
            <h4>languages:</h4>
            {<Languages languages={languages}/>}
        </div>
    )
}

export default Country
